import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  NavLink,
} from "react-router-dom";
import Home from "./components/Home/Home";
import About from "./components/About/About";
import Curriculum from "./components/Curriculum/Curriculum";
import Services from "./components/Services/Services";
import Contact from "./components/Contact/Contact";
function App() {
  return (
    <div className="App">
      <Router>
        <NavLink
          to="/"

          activeStyle={{
            fontWeight: "bold",
            color: "red",
          }}
        >
          FAQs
        </NavLink>

        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/services">
            <Services />
          </Route>
          <Route path="/curriculum">
            <Curriculum />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
